package Academy;

import java.util.ArrayList;

public class MakeStringAsPalindrome {
    public static void main(String[] args) {
                String A="                String A=\"";
                int len=0;
                StringBuilder str=new StringBuilder();
                str.append(A.charAt(0));

                ArrayList<String> prefix=new ArrayList<String>();

                prefix.add(String.valueOf(A.charAt(0)));

                for(int j=1;j<A.length();j++)
                {
                    prefix.add(A.charAt(j)+prefix.get(j-1));
                }

                for(int i=1;i<A.length();i++)
                {
                    str.append(A.charAt(i));
                    //StringBuilder temp=new StringBuilder(str);
                    //if(str.toString().equals(temp.reverse().toString()))
                    if(str.toString().equals(prefix.get(i)))
                    {
                        len=str.length();
                    }
                }


                if(len==A.length())
                {
                    System.out.println(0);
                    System.exit(1);
                }

                if(len==0)
                {
                    System.out.println(A.length()-1);
                    System.exit(1);
                }else
                {
                    System.out.println(A.length()-len);
                }
    }
}
